import React from 'react'

const Header = () => {
  return (
    <header className='w-full p-0 bg-blue'>
        <nav className='max-w-full ml-0 container px-4 flex justify-between items-center py-3'>
            <div style={logoStyle}>Logo</div>
            <div style={titleStyle} className='text-center'>can-pare</div>

        </nav>
    </header>
  )
}

const headerStyle = {
    height: '80px',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    padding: '0 20px',
    position: 'fixed',
    width: '100%',
    top: 0,
    backgroundColor: '#fff',
    borderBottom: '1px solid #ccc'
  };

  const logoStyle = { flex: 1 };
  const titleStyle = { flex: 2, textAlign: 'center' };

export default Header
